import React, { useState, useEffect } from "react";
import { JoblyApi } from "./Api";
// import {useHistory} from "react-router-dom"



export const Signup = ({register}) => {

    const [token, setToken] = useState();
    useEffect(() => {
        async function getToken() {
            const getToken = await JoblyApi.login();
            setToken(getToken);
    }
        getToken();

   }, [])

    // const history = useHistory();
        const form = {
        username: "",
        password: "",
        firstName: "",
        lastName: "",
        email: ""
        };


    const [signup, setSignup] = useState(form);
    async function handleSubmit(e) {
        e.preventDefault();
        register(signup.username, signup.password, signup.firstName, signup.lastName, signup.email);

        //  history.push(`/${form.type}`);
        // setNewForm(initialState);
        }







    const handleChange = (e) => {
        const { name, value } = e.target;
        setSignup( prevState => ({
            ...prevState,
            [name]: value
        }));


    };



    return (
        <>
            <h1>Signup</h1>

            { console.log(signup)}
            { console.log(token)}
            <form onSubmit={handleSubmit}>
                {

                }
                <label htmlFor="username"><b>Username</b></label>  
                <input
                    name="username"
                    type="text"
                    onChange={handleChange}
                    value={signup.username}
                />

                <label htmlFor="password"><b>Password</b></label> 
                <input
                    name="password"
                    type="text"
                    onChange={handleChange}
                    value={signup.password}
                />

                <label htmlFor="firstname"><b>First name</b></label> 
                <input
                    name="firstname"
                    type="text"
                    onChange={handleChange}
                    value={signup.firstName}
                />

                <label htmlFor="lastname"><b>Last name</b></label> 
                <input
                    name="lastname"
                    type="text"
                    onChange={handleChange}
                    value={form.lastName}
                />

                <label htmlFor="email"><b>Email</b></label> 
                <input
                    name="email"
                    type="text"
                    onChange={handleChange}
                    value={signup.email}
                />

                <br/>
                <button> Submit </button>
            </form>


        </>
    )
            }
